import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import ProgressBar from "react-bootstrap/ProgressBar";

const categories = [
  { name: "Web Exploitation", progress: 60 },
  { name: "Cryptography", progress: 40 },
  { name: "Network Security", progress: 80 },
  { name: "Reverse Engineering", progress: 20 },
  { name: "Binary Exploitation", progress: 100 },
];

const ChallengeLanding = () => {
  return (
    <div>
      <Container className="mt-4">
        <h1 className="text-center">Progress Overview</h1>
        <Row className="mt-4">
          {categories.map((category, index) => (
            <Col key={index} md={6} className="mb-3">
              <h5>{category.name}</h5>
              <ProgressBar
                now={category.progress}
                label={`${category.progress}%`}
              />
            </Col>
          ))}
        </Row>
      </Container>
    </div>
  );
};

export default ChallengeLanding;
